import React from "react";
import { Col, Container, Row } from "react-bootstrap";

const About = () => {
  return (
    <Container>
      <div className="box">
        <div id="about">
          <span>About me</span>
          <div>
            <img src="./Images/PC.jpg" className="pc img-fluid" alt="pc" />
          </div>
          <div></div>
          
        </div>
      </div>
    </Container>
  );
};

export default About;
